INSERT INTO `brands`(`id`, `name`, `images`, `trade_mark`, `description`, `link`, `honors`, `service_tel`, `created_at`, `updated_at`, `letter`, `initial`, `user_id`, `status`) VALUES (3, '测试-------马可波罗', '[\"images\\/de963fedb7e5adc2aad5141bc0d8bb25.jpg\",\"images\\/bd1184d19717af4f9d64a570aff1e0c3.jpg\",\"images\\/f1bf9c008bd652d6e6fa99a000079b47.jpg\"]', 'images/002655487b620cd084c23f803813844c.jpg', '马可波罗瓷砖是广东唯美陶瓷有限公司主打产品，总部位于现代制造业名城——东莞市，是国内规模最大的建筑陶瓷制造商和销售商之一。\r\n“马可波罗”品牌诞生于1996年，作为国内最早品牌化的建陶品牌，以“文化陶瓷”占领市场，享有“仿古砖至尊”的美誉。被中国陶瓷卫浴品牌网评选为2013年中国陶瓷十大品牌，是国内建陶产品系列最全的品牌。企业拥有380多项专利，其自主研发的原创设计──“中国印象”系列产品，将中国传统文化之精髓展现在瓷砖上，引导设计之风回归东方禅韵，受到国内外消费者和专家的广泛关注。', 'http://cloudbrickcity.cn/admin/brand/create', '[\"images\\/ace31d1850abefc152366bed44460562.jpeg\",\"images\\/bdd5a9b506637a58ad9d2968a3fa5b62.png\",\"images\\/index_img16.png\"]', '444-4444-444', '2018-12-03 13:14:57', '2018-12-03 13:14:57', 'ce shi ma ke bo luo', 'c', 18, 1);
